import React, { Component } from "react";
import _loadWeather from "/Users/josefutleg/Desktop/projects/fika/fika/client/src/services/weatherService.js";

class Weather extends Component {
  state = { weather: null };

  componentDidMount() {
    return _loadWeather().then(resultingJSON =>
      this.setState({ weather: resultingJSON })
    );
  }
  render() {
    return (
      <div>
        {this.state.weather.map(x => (
          <p key={x.id}>
            <span>{x.temp}</span>
            <span>{x.timestamp}</span>
            <span>{x.description}</span>
          </p>
        ))}
      </div>
    );
  }
}

export default Weather;
